            "KL The Guide is a quarterly guidebook, first published in August 2007. We are a free travel guidebook that helps travellers make their travel plans around Malaysia s capital city, Kuala Lumpur. Klang Valley For Locals includes travel tips, places to explore, kid-friendly locations, hotels, and more. With KL The Guide, navigating the city becomes easier."),
